import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const Container = styled.div`
  max-width: 1440px;
  align-items: center;
`;

const Header = styled.div`
  height: 80px;
  width: 100%;
  position: absolute;
  top: 0px;
  display: flex;
  z-index: 100;
  align-items: center;
  justify-content: space-between;
  max-width: 1440px;
  margin-right: auto;
  margin-left: auto;
  > a {
    text-decoration: none;
    color: #555;
    &hover {
      color: #ff6060;
    }
  }
`;

function Navigation() {
  return (
    <Container>
      <Header>
        <Link to="/">Noah Jung</Link>
        {/* <Naviagtion> */}
        <Link to="/">About</Link>
        <Link to="/">Work</Link>
        {/* </Naviagtion> */}
      </Header>
    </Container>
  );
}

export default Navigation;
